import { GoogleGenerativeAI, Part } from "@google/generative-ai";

export async function GET(request: Request) {
  // Change to GET request
  try {
    const apiKey = process.env.GOOGLE_API_KEY;
    if (!apiKey) {
      throw new Error("GOOGLE_API_KEY is not defined");
    }

    const base64Image =
      ""; // Replace with your base64 image

    if (!base64Image) {
      return new Response("Image data is missing.", { status: 400 });
    }

    const genAI = new GoogleGenerativeAI(apiKey);
    const model = genAI.getGenerativeModel({ model: "gemini-1.5-flash" }); // Use gemini-pro-vision

    const imageParts: Part[] = [
      {
        inlineData: {
          mimeType: "image/jpeg", // Adjust mime type if necessary
          data: base64Image,
        },
      },
    ];

    const prompt =
      "Describe this image in only 4 sentenses seperate esch description with ||";

    const result = await model.generateContent([prompt, ...imageParts]);

    const description =
      result.response?.candidates?.[0]?.content?.parts?.[0]?.text ??
      "Could not generate a description.";

    return Response.json(
      {
        success: true,
        description: description,
      },
      { status: 200 } // Use 200 OK for GET requests
    );
  } catch (error) {
    if (error instanceof Error) {
      return new Response(error.message, { status: 400 });
    } else {
      console.error("An unexpected error occurred", error);
      return new Response("Internal server error", { status: 500 }); // More appropriate 500 code.
    }
  }
}
